import React, { Fragment, useEffect, useState } from 'react';
import Sheet from 'react-modal-sheet';


const MessagingPanePrivateHelper = ({ messagePaneOpen, setMessagePaneState }) => {
    console.log("messagePaneOpen", messagePaneOpen);

    return (
        <Fragment>
            <Sheet isOpen={messagePaneOpen} onClose={() => setMessagePaneState(false)}>
                <Sheet.Container>
                <Sheet.Header />
                <Sheet.Content>{/* Your sheet content goes here */}</Sheet.Content>
                </Sheet.Container>

                <Sheet.Backdrop />
            </Sheet>
        </Fragment>
    );
}
export default MessagingPanePrivateHelper;
